function scaleFill(){
	maxW = d3.max(dataset,function(d){return d.AMT});
	maxH = d3.max(dataset,function(d){return d.CNT});

	xScale2 = d3.scale.linear()
	.domain([0,maxW])
	.range([gap,w-gap]);	

	yScale2 = d3.scale.linear()
	.domain([0,maxH])
	.range([h-gap,gap]);

	rScale2 = d3.scale.linear()
	.domain([0,maxW*maxH])
	.range([10,(h*w)/10000]);

	xDurScale = d3.scale.linear()
	.domain([0,maxW])
	.range([100,500]);

	yDurScale = d3.scale.linear()
	.domain([0,maxH])
	.range([100,500]);


	console.log(maxW,maxH);

	xAxis2 = d3.svg.axis()
	   	.scale(xScale2)
	   	.orient("bottom")
	   	.ticks(10);

   	yAxis2 = d3.svg.axis()
	   	.scale(yScale2)
	   	.orient("left")
	   	.ticks(10);

}

