	svg = d3.selectAll("body").append("svg").attr("width",w).attr("height",h);
	
	divTooltip = d3.selectAll("body").append("div").attr("class","divTooltip").style("opacity",0);
	
	circles = svg.selectAll("circle").data(dataset).enter().append("circle")	
